INSERT INTO `products` (`id`, `nome`, `descricao`, `price_pack_1`, `price_pack_5`, `price_pack_10`, `price_pack_20`, `stock`, `imagem_1_pack`, `imagem_5_pack`, `imagem_10_pack`, `imagem_20_pack`, `type`) VALUES
(1, 'Google Review Cards', 'Elevate your feedback mechanism with Tap&Go\'s NFC Google Review Cards, available in packs of 5, 10, or 20. More than just a conduit for reviews, these cards serve a dual purpose: directing users to leave feedback and capturing intricate phone usage statistics. Understand daily device trends, operating system preferences, and more, all from our complimentary dashboard. Choose the pack that best suits your needs and get insights that drive value.', 16.95, 49.95, 79.95, 119.95, 700, 'assets/img/products/1_cartao_google.webp', 'assets/img/products/5_cartoes_google.webp', 'assets/img/products/10_cartoes_google.webp', 'assets/img/products/20_cartoes_google.webp', 'Google'),
(4, 'Tripadvisor Review Cards', 'Harness the power of feedback and data with Tap&Go\'s NFC TripAdvisor Review Cards, available in sets of 5, 10, or 20. Each tap not only encourages a TripAdvisor review but also unveils rich statistics about the user\'s phone habits. Access insights like daily usage patterns, device type distribution, and operating system choices, all through our free, intuitive dashboard. Opt for the quantity that aligns with your goals and unlock unparalleled insights.', 16.95, 49.95, 79.95, 119.95, 300, 'assets/img/products/1_cartao_tripadvisor.webp', 'assets/img/products/5_cartoes_tripadvisor.webp', 'assets/img/products/10_cartoes_tripadvisor.webp', 'assets/img/products/20_cartoes_tripadvisor.webp', 'Tripadvisor'),
(5, 'Instagram Cards', 'Experience the convenience of our state-of-the-art NFC cards. You\'ll have NFC cards at your disposal, allowing your customers to instantly check your business\'s profile effortlessly. Enhance your influence and help businesses serve you better with ease.', 16.95, 49.95, 79.95, 119.95, 0, 'assets/img/products/1_cartao_instagram.webp', 'assets/img/products/5_cartoes_instagram.webp', 'assets/img/products/10_cartoes_instagram.webp', 'assets/img/products/20_cartoes_instagram.webp', 'Instagram'),
(6, 'WhatsApp Cards', 'Experience the convenience of our state-of-the-art NFC cards. You\'ll have NFC cards at your disposal, allowing your customers to instantly check your business\'s whatsapp effortlessly. Enhance your influence and help businesses serve you better with ease.', 16.95, 49.95, 79.95, 119.95, 0, 'assets/img/products/1_cartao_whatsapp.webp', 'assets/img/products/5_cartoes_whatsapp.webp', 'assets/img/products/10_cartoes_whatsapp.webp', 'assets/img/products/20_cartoes_whatsapp.webp', 'Whatsapp');
